import{_ as t,d as e,n as a,z as s,c as i,b as n,g as d,t as f,D as p,j as l,o as r,l as y,m as g}from"../default/default-d3b4a7ff.js";const o=t=>(y("data-v-9f145de6"),t=t(),g(),t),h={class:"pact-page"},v=l('<h3 style="font-size:0.6rem;text-align:center;text-justify:inter-ideograph;margin-bottom:10px;" data-v-9f145de6>《趣融分期注册协议》</h3><p style="padding:0;" data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>      趣融分期（以下简称“趣融分期”或“平台”）由</span><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>趣创业（北京）科技</span><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6><span style="font-family:华文细黑;" data-v-9f145de6>有限公司（注册地址北京市顺义区北务镇政府街</span>9号-787）（以下可简称“我们”）运营，我们依照本协议约定向您（本文统称“您”或“用户”）提供服务。请您注册成为趣融分期用户前仔细阅读本协议，</span><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>尤其是与您的权益有或可能有重大关系或对我们具有或可能具有免责或限制责任的加粗条款，请特别注意。</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>本协议一经您勾选或通过点击页面同意按钮或您接受我们提供的服务即视为您已仔细阅读并明确同意遵守本协议所有内容。</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>我们可能根据法律法规、监管政策的要求或业务运营的需要，对本协议内容不时进行修改，除非另有规定，修改后的内容由我们发布之后即生效。您应不时关注平台公告、提示信息及协议、规则等相关内容的变动。您知悉并确认，如您不同意修改后的内容，应立即停止使用我们的服务；如您继续使用我们的服务，即视为知悉修改内容并同意接受。</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><span style="font-family:&#39;Times New Roman&#39;;color:rgb(42, 42, 42);font-size:0.35rem;line-height:1.6;" data-v-9f145de6><span style="font-family:微软雅黑;" data-v-9f145de6>一、服务内容</span></span></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>1.1我们可为用户提供借款咨询、资信评估、产品/服务推荐、账户管理等服务，具体服务内容以平台展示及我们实际提供的为准。我们对提供的服务拥有最终解释权。</span></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>1.2您知悉并同意我们将定期或不定期通过电子邮件、短信、电话或站内信等形式为您推送平台产品、平台活动、其他我们认为您可能感兴趣的产品、活动等（此类简称“个性化服务信息”）。如果您不想接收我们给您发送的个性化服务信息，您随时可通过以下方式取消：</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6><span style="font-family:华文细黑;" data-v-9f145de6>（</span>1）您可以回复“T”或“TD”（具体以短信内容中提示为准）来取消我们给您发送的个性化服务短信；</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6><span style="font-family:华文细黑;" data-v-9f145de6>（</span>2）您可以通过拨打我们官方电话13466686002、要求取消个性化服务（站内信、站内通知、短信、电话）。</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>1.3您使用我们提供的服务时所需的相关的设备以及网络资源等（如个人电脑、手机及其他与接入互联网或移动网有关的装置）及所需的费用（如为接入互联网而支付的电话费及上网费）均由您自行负担。</span></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><span style="font-family:&#39;Times New Roman&#39;;color:rgb(42, 42, 42);font-size:0.35rem;line-height:1.6;" data-v-9f145de6><span style="font-family:微软雅黑;" data-v-9f145de6>二、使用准则</span></span></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>2.1您在使用我们提供的服务过程中，必须遵循国家的相关法律法规，不得出现以下行为：</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>(1)反对宪法所确定的基本原则的；</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>(2)危害国家安全，泄露国家秘密，颠覆国家政权，破坏国家统一的；</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>(3)损害国家荣誉和利益的；</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>(4)煽动民族仇恨、民族歧视，破坏民族团结的；</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>(5)破坏国家宗教政策，宣扬邪教和封建迷信的；</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>(6)散布谣言，扰乱社会秩序，破坏社会稳定的；</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>(7)散布淫秽、色情、赌博、暴力、凶杀、恐怖或者教唆犯罪的、欺诈性的或以其它令人反感的讯息、数据、信息、文本、音乐、声音、照片、图形、代码或其它材料；</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>(8)侮辱或者诽谤他人，侵害他人合法权益的；</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>(9)可能侵犯他人的专利、商标、商业秘密、版权或其它知识产权或专有权利的；</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>(10)假冒任何人或实体或以其它方式歪曲您与任何人或实体之关联性的内容；</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>(11)未经授权发布第三方的私人信息，包括但不限于地址、电话号码、电子邮件地址、身份证号以及银行卡卡号；</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>(12)发布病毒、不可靠数据或其它有害的、破坏性的或危害性的文件；</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>(13)其他违反宪法和法律、行政法规或规章制度等的行为。</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>2.2用户不得利用我们的服务从事下列危害互联网信息网络安全的活动：</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>(1)未经允许，进入互联网信息网络或者使用互联网信息网络资源；</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>(2)未经允许，对互联网信息网络功能进行删除、修改或者增加；</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>(3)未经允许，对进入互联网信息网络中存储、处理或者传输的数据和应用程序进行删除、修改或者增加；</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>(4)故意制作、传播计算机或手机病毒等破坏性程序；</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>(5)其他危害互联网信息网络安全的行为。</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>2.3您确认，在您开始注册并使用我们提供的服务时，您应当具备中华人民共和国法律规定的与您行为相适应的民事行为能力。若您不具备签署与您行为相适应的民事行为能力，则您及您的监护人应依照法律规定承担因此而造成的一切后果。</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>2.4如您的操作影响系统总体稳定性或完整性，我们将暂停或终止您的操作，直到相关问题得到解决。</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>2.5 您必须妥善保管您的用户账户、密码及您在其项下填写的所有信息，您不得将您的用户账号、密码进行转让、出售或授权其他第三方使用，所有通过您的用户账户的操作均视为您本人的操作，您应对所有的操作行为及后果负责。</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><span style="font-family:&#39;Times New Roman&#39;;color:rgb(42, 42, 42);font-size:0.35rem;line-height:1.6;" data-v-9f145de6><span style="font-family:微软雅黑;" data-v-9f145de6>三、免责声明</span></span></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>3.1 非因我方原因，对任何第三方通过趣融分期对您因做出违反本协议、法律法规、道德标准的行为而对您造成的任何损害，我们不对此承担责任。</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>3.2对黑客行为、计算机或手机病毒、或因您保管疏忽致使帐号、密码被他人非法使用、盗用、篡改的或丢失，或您因其他非我们原因造成的损失，我们不承担责任。如您发现任何非法使用用户帐号或安全漏洞的情况，请立即与我们联系。</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>3.3我们不保证服务一定能满足您的要求，不保证服务不会中断，也不保证服务的及时性、安全性、准确性。</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>3.4用户对本协议的签署意味着用户同意自行承担对使用我们服务所产生的风险，对所提供的网络服务，我们将尽最大努力，维护其及时性、安全性、准确性，但对此不作任何承诺。对于因不可抗力或我们不能控制的原因造成的网络服务中断或其它缺陷，我们不承担任何责任，但将尽力减少因此而给用户造成的损失和影响。</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>3.5用户确认知悉，我们仅提供借款咨询、资信评估、产品/服务推荐、账户管理等相关服务，我们不参与基于交易行为发生的资金管理及划付行为，我们对用户以完成交易为目的的资金管理及划付服务的指令、最终的结果、时效性不承担任何责任。</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><span style="font-family:&#39;Times New Roman&#39;;color:rgb(42, 42, 42);font-size:0.35rem;line-height:1.6;" data-v-9f145de6><span style="font-family:微软雅黑;" data-v-9f145de6>四、服务变更、中断或终止</span></span></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>4.1如因升级的需要而需暂停服务、或调整服务内容，我们将尽可能在及时在平台上进行通告。由于用户未能及时浏览通告而造成的损失，我们不承担任何责任。</span></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>4.2您明确同意，我们保留根据实际情况随时调整我们提供的服务内容、种类和形式，或自行决定授权第三方向您提供原本我们提供的服务。服务一经变更，我们将会在平台上提示变更内容，不再另行单独通知，您应不时注意本协议条款及相关规则的变动。如果不同意所改动的内容，您可以主动拒绝使用我们提供的服务。如果您继续使用我们提供的服务，则视为接受服务条款的变动。</span></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>4.3发生下列任何一种情形，我们有权单方面中断或终止向您提供服务而无需通知您，且无需对您或第三方承担任何责任：</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>(1)您提供的个人资料不真实；</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>(2)您的行为违反本协议；</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>(3)您的行为违反法律法规规定。</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>4.4 您有权在满足条件的情况下通知我们终止向您提供服务，或直接取消我们服务。针对您终止或取消服务之日后的行为，我们不再向您承担任何形式的责任。</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><span style="font-family:&#39;Times New Roman&#39;;color:rgb(42, 42, 42);font-size:0.35rem;line-height:1.6;" data-v-9f145de6><span style="font-family:微软雅黑;" data-v-9f145de6>五、知识产权及其它权利</span></span></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>5.1我们是对平台享有全部权利，包括全部著作权、商标权、专利权、商业秘密等知识产权，以及包括但不限于文字、图片、视频、界面设计、版面框架、有关数据或电子文档均受相关法律法规保护。未经我们书面同意，您不得为任何商业及或非商业目的自行或许可第三方实施、利用、转让上述知识产权，我们保留追究上述法律责任的权利。</span></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>5.2未经相关内容权利人的事先书面同意，您不得擅自复制、传播在平台内的相关内容，或将其用于任何商业目的，所有这些资料或资料的任何部分仅可作为个人或非商业用途而保存在某台计算机或其他电子设备内。否则，我们及/或权利人将追究您的法律责任。</span></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><span style="font-family:&#39;Times New Roman&#39;;color:rgb(42, 42, 42);font-size:0.35rem;line-height:1.6;" data-v-9f145de6><span style="font-family:微软雅黑;" data-v-9f145de6>六、信息提供和隐私保护</span></span></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>6.1您在访问、使用平台申请使用我们提供的服务时，必须提供您真实的个人信息，且您应该根据实际变动情况及时更新个人信息。保护用户隐私是我们的基本原则，我们通过各种技术手段和强化内部管理等办法提供隐私保护服务功能，充分保护您的个人信息安全。</span></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>6.2您应保证您提供的个人信息的真实性、准确性或完整性，因信息不真实、不准确或不完整而引起的任何问题及其后果，由您自行承担，且您应保证我们免受由此而产生的任何损害或责任。若我们发现您提供的个人信息是虚假、不准确或不完整的，我们有权自行决定终止向您提供服务并要求您赔偿我们的损失。</span></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><strong data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>6.3为更好的为您提供服务，您同意并授权我们将收集的您的个人信息用于与我们合作的第三方进行联合研究，我们与我们合作的第三方在开展上述联合研究前，应要求我们合作的第三方对在联合研究中所获取的您的信息予以保密。</span></strong></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>6.4当我们与您电话核实信息或帮助您处理问题时，为保证为您服务的质量，你同意我们对上述电话进行录音。</span></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><span style="font-family:&#39;Times New Roman&#39;;color:rgb(42, 42, 42);font-size:0.35rem;line-height:1.6;" data-v-9f145de6><span style="font-family:微软雅黑;" data-v-9f145de6>七、特别约定</span></span></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>7.1您使用平台服务的行为若有任何违反国家法律法规或侵犯任何第三方的合法权益的情形时，我们有权暂停或终止向您提供服务。</span></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>7.2您同意我们通过页面的公告、通告、电子邮件以及常规信件等的形式向您送达与我们服务有关的任何通知和通告。</span></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>7.3如您有任何有关与我们提供的服务相关的咨询，可以通过客服电话</span><strong data-v-9f145de6><span style="font-family:微软雅黑;color:rgb(42, 42, 42);font-size:0.35rem;line-height:1.6;" data-v-9f145de6>13466686002</span></strong><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6><span style="font-family:华文细黑;" data-v-9f145de6>与我们联系，我们将在接到咨询之日起</span>15日内进行答复。</span></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>7.4 本协议之效力、解释、执行均适用中华人民共和国法律。</span></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>7.5如就本协议内容或其执行发生任何争议，应尽量友好协商解决；协商不成时，任何一方均可向协议签订地北京市海淀区人民法院提起诉讼。</span></p><p style="text-align:justify;text-justify:inter-ideograph;" data-v-9f145de6><span style="font-size:0.35rem;line-height:1.6;" data-v-9f145de6>7.6本协议中的标题仅为方便而设，不影响对于条款本身的解释。</span></p>',63),u={style:{"text-align":"justify","text-justify":"inter-ideograph"}},x={style:{"font-family":"'Times New Roman'",color:"rgb(42, 42, 42)","font-size":"0.35rem","line-height":"1.6"}},j=o((()=>n("span",{style:{"font-family":"微软雅黑"}},"您的登录账号：",-1))),m={style:{"text-align":"justify","text-justify":"inter-ideograph"}},z=o((()=>n("span",{style:{"font-size":"0.35rem","line-height":"1.6"}},[n("span",null,"您的"),d("UID")],-1))),b=o((()=>n("span",{style:{"font-family":"'Times New Roman'",color:"rgb(42, 42, 42)","font-size":"0.35rem","line-height":"1.6"}},[n("span",null,"：")],-1))),c={style:{"font-family":"'Times New Roman'",color:"rgb(42, 42, 42)","font-size":"0.35rem","line-height":"1.6"}},T=o((()=>n("p",null,[n("span",{style:{"font-family":"Calibri","font-size":"14px"}}," ")],-1))),w=o((()=>n("p",null,[n("br")],-1)));var N=t(e({__name:"reg",setup(t){const e=a();return s((()=>{window.scrollTo(0,0)})),(t,a)=>(r(),i("div",h,[v,n("p",u,[n("span",x,[j,d(f(p(e).holder.mobile?p(e).holder.mobile.substring(0,3)+"****"+p(e).holder.mobile.substring(7):"****"),1)])]),n("p",m,[z,b,n("span",c,f(p(e).holder.id?p(e).holder.id:"****"),1)]),T,w]))}}),[["__scopeId","data-v-9f145de6"]]);export{N as default};
